import React from 'react';
import Youtube from '../../../assets/pics/youtube.svg';

const Music = (props) => {

		const dataLocal = props.dataLocal

		const display = (
				<div>
						<div className='infoCategory'>
						{dataLocal.category}
						</div>

						<div className='infoTitle'>
						{dataLocal.title}
						</div>

						<ul className='musicList'>
						dataLocal.songs.map(song => (
						<li key={songTitle} className='songs'>{songTitle}</li>))
						</ul>

						<ul className='musicLink'>
						dataLocal.songs.map(link => (
						<li key={songLink} className='songs'>
						<a href={songLink} target='_blank' rel="noopener noreferrer" className='musicLinkIcon'>
						<img src={Youtube} alt='youtube' className='musicLinkIcon'/>
						</a>
						</li>
						))
						</ul>

				</div>
		)
	console.log(dataLocal)
		return (
				<div>
						{display}
				</div>
		)
}
export default Music;
